import React from 'react';
import AliceCarousel from 'react-alice-carousel';
import 'react-alice-carousel/lib/alice-carousel.css';
import CardData from './ServicesData'


const responsive = {
  0: { items: 1 },
  568: { items: 2 },
  1024: { items: 3 },
};


const ProCrousel = () => {
  // console.log(data)
  return (
 <>
 <div className='container'>
    <div className='row'>
        <AliceCarousel
          mouseTracking
          responsive={responsive}
          controlsStrategy="alternate"
          autoPlay={true}
          autoPlayInterval={1500}
          disableButtonsControls={true}
          >
           {CardData.map((data) =>{
             console.log(data)
             return(
               <>
               <div>
               <div className="item" data-value="3">{data.Title}</div>
               </div>
               </>
             )
             })}
        </AliceCarousel>
        </div>
    </div>
 </>
  );
}

export default ProCrousel;
